(8, NULL, NULL, NULL, 'Welcome to KODFans', '<div align=\"center\"><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\"><img src=\"data:image/jpeg;base64,\" style=\"width: 1000.84px; height: 266.688px;\" data-filename=\"KOD Logo Tirle_Big.jpg\"><b style=\"font-size: 1rem;\"><span style=\"font-size:13.5pt;font-family:&quot;Source Sans Pro&quot;,sans-serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Open Sans&quot;;\ncolor:#00007D\"><br></span></b></div><div style=\"text-align: left;\"><b style=\"font-size: 1rem;\"><span style=\"font-size:13.5pt;font-family:&quot;Source Sans Pro&quot;,sans-serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Open Sans&quot;;\ncolor:#00007D\"><br></span></b></div><p class=\"MsoNormal\" style=\"text-align: left; line-height: 80%;\"><span style=\"font-size: 14pt; line-height: 80%; font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(0, 0, 125); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: left; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:14.0pt;\nfont-family:&quot;Source Sans Pro&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#00007D\">Welcome to KODFans! Thank\nyou very much for joining.&nbsp;KODFans is committed to the online safety and\nsecurity of all our Users.</span><span style=\"font-size: 12pt; font-family: &quot;Source Sans Pro&quot;, sans-serif;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: left; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(0, 0, 125); font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 14pt;\">You now have access to\nthe Website and all its interactive features.</span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: left; line-height: 80%;\"><b><span style=\"font-size:14.0pt;\nline-height:80%;font-family:&quot;Source Sans Pro&quot;,sans-serif;mso-fareast-font-family:\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#00007D\">Let’s\nget started<o:p></o:p></span></b></p>\n\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-align: left; text-indent: -0.25in; line-height: 80%; margin-left: 25px;\"><!--[if !supportLists]--><span style=\"font-size:14.0pt;\nline-height:80%;font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\nSymbol;color:#00007D\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><span style=\"font-size:14.0pt;line-height:80%;\nfont-family:&quot;Source Sans Pro&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#00007D\">Login and you will be directed\nto your Home page.<o:p></o:p></span></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: left; text-indent: -0.25in; line-height: 80%; margin-left: 25px;\"><!--[if !supportLists]--><span style=\"font-size:14.0pt;\nline-height:80%;font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\nSymbol;color:#00007D\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\