imes New Roman&quot;;color:#00007D\">Choose a Display Name. This\nis your searchable name which will be used throughout the Website. <o:p></o:p></span></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: left; text-indent: -0.25in; line-height: 80%; margin-left: 25px;\"><!--[if !supportLists]--><span style=\"font-size:14.0pt;\nline-height:80%;font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\nSymbol;color:#00007D;mso-bidi-font-weight:bold\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><b><span style=\"font-size:14.0pt;line-height:80%;font-family:&quot;Source Sans Pro&quot;,sans-serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:#00007D\">FOR PRIVACY AND SECURITY, WE RECOMMEND THAT YOU DO NOT USE YOUR\nREAL NAME.<o:p></o:p></span></b></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: left; text-indent: -0.25in; line-height: 80%; margin-left: 25px;\"><!--[if !supportLists]--><span style=\"font-size:14.0pt;\nline-height:80%;font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\nSymbol;color:#00007D\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><span style=\"font-size:14.0pt;line-height:80%;\nfont-family:&quot;Source Sans Pro&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#00007D\">Complete your profile\ndescription which will be displayed below your below your picture. <o:p></o:p></span></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: left; text-indent: -0.25in; line-height: 80%; margin-left: 25px;\"><!--[if !supportLists]--><span style=\"font-size:14.0pt;\nline-height:80%;font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\nSymbol;color:#00007D\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><span style=\"font-size:14.0pt;line-height:80%;\nfont-family:&quot;Source Sans Pro&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#00007D\">Meet the Creator page –\nselect your category and upload a picture and or short video introduction\n(limited to 30 seconds).<o:p></o:p></span></p>\n\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-align: left; text-indent: -0.25in; line-height: 80%; margin-left: 25px;\"><!--[if !supportLists]--><span style=\"font-size:14.0pt;\nline-height:80%;font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\nSymbol;color:#00007D\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><span style=\"font-size:14.0pt;line-height:80%;\nfont-family:&quot;Source Sans Pro&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#00007D\">Click Save.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: left; line-height: 80%;\"><b><span style=\"font-size:14.0pt;\nline-height:80%;font-family:&quot;Source Sans Pro&quot;,sans-serif;mso-fareast-font-family:\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#00007D\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" style=\"text-ali