(51, 92, NULL, NULL, 'Join the world\'s largest music festival, Ultra Fest 2024, in March 22,23,24.', '<p>It was first held on&nbsp;<a class=\"mw-redirect\" title=\"Miami Beach\" href=\"https://en.wikipedia.org/wiki/Miami_Beach\">Miami Beach</a>, but besides a tenure at&nbsp;<a title=\"Museum Park (Miami)\" href=\"https://en.wikipedia.org/wiki/Museum_Park_(Miami)\">Bicentennial Park</a>, and briefly being held at&nbsp;<a title=\"Virginia Key\" href=\"https://en.wikipedia.org/wiki/Virginia_Key\">Virginia Key</a>&nbsp;in 2019, it has primarily been held at&nbsp;<a title=\"Bayfront Park\" href=\"https://en.wikipedia.org/wiki/Bayfront_Park\">Bayfront Park</a>&nbsp;in&nbsp;<a class=\"mw-redirect\" title=\"Downtown Miami\" href=\"https://en.wikipedia.org/wiki/Downtown_Miami\">downtown Miami</a>. It was a two-day festival from 1998 to 2006.</p>\r\n<p>2022: <a href=\"https://www.youtube.com/embed/rzLcLFjSTfs?autoplay=1\">https://www.youtube.com/embed/rzLcLFjSTfs?autoplay=1</a></p>\r\n<p>2017: <a href=\"https://www.youtube.com/embed/2pQIkk--YyM?autoplay=1\">https://www.youtube.com/embed/2pQIkk--YyM?autoplay=1</a></p>\r\n<p><strong class=\"dates \">March 22, 23, 24 - 2024</strong><br>Bayfront Park<br>Downtown Miami, FL</p>', 'miami-gallery-2019-25-1600x1066.jpg', NULL, 1, '2024-01-04 17:04:43', '2024-01-04 17:04:43'),
(52, 100, NULL, NULL, 'demo template', '<p>body</p>', 'simon-lee-O3oIMSvv6O8-unsplash.jpg', NULL, 1, '2024-01-05 05:56:15', '2024-01-05 11:56:15');
INSERT INTO `event` (`event_id`, `user_id`, `event_name`, `event_description`, `event_participant`, `event_address`, `event_latitude`, `event_longitude`, `event_country`, `event_state`, `event_city`, `event_zipcode`, `event_price`, `event_date`, `event_time`, `status`, `slug`, `co_host_id`, `created_at`, `updated_at`) VALUES
(107, 107, 'Piyush Mishra\'s Ballimaaraan', '<p>Prepare for a captivating musical odyssey with the iconic&nbsp;<strong>Piyush Mishra\'s \"Ballimaaraan\"</strong>. Known for his poetic prowess and versatile artistry, Mishra\'s live performance promises an evening of soulful melodies and poignant storytelling. Secure your tickets for an unforgettable experience with one of India\'s artistic gems.</p>', NULL, 'Gymkhana Club Sector-29 / Sector 30, South City I, Sector 29, Gurugram, Haryana', '28.464957', '77.062159', 'India', 'Haryana', 'Gurgaon Division', '122007', 749.00, '2024-03-01', '10:30 AM', '1', 'piyush-mishras-ballimaaraan', NULL, '2024-02-02 00:54:13', '2024-02-02 06:54:13'),
(108, 108, 'Darshan Raval India Tour', '<p>Get ready for an unforgettable musical journey as Darshan Raval, the heartthrob of Indian music, embarks on his much-anticipated nationwide tour - This extraordinary concert series promises to be a celebration of love, emotions, and the magic of Darshan Raval\'s soulful voice.</p>\r\n<p>The tour kicks off in Surat and will traverse the length and breadth of India, bringing Darshan\'s chart-topping hits to fans across the country.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Audiences can expect a visually stunning and immersive experience, with state-of-the-art stage production, lighting, and sound engineering to complement the musical extravaganza. Each concert is meticulously crafted to provide an intimate yet electrifying atmosphere, allowing fans to connect with Darshan Raval on a personal level.</p>\r\n<p>&nbsp;</p>\r\n<p>With a mix of soul-stirring melodies and high-energy performances, the tour promises to cater to every musical taste, making it a must-attend event for fans and music enthusiasts alike.</p>\r\n<p>&nbsp;</p>\r\n<p>Don\'t miss the chance to be a part of this musical spectacle. Join Darshan Raval on this tour for an evening filled with love, rhythm, and the enchanting magic of his soul-stirring tunes. Get ready to be swept away on a musical odyssey that promises to be the highlight of the year for music lovers across India.</p>', NULL, 'Delhi Gymkhana Club, New Delhi, Delhi, India', '28.598096', '77.2042274', 'India', 'Delhi', 'Delhi Division', '110021', 499.00, '2024-01-10', '03:39 PM', '1', 'darshan-raval-india-tour', NULL, '2024-02-02 01:08:05', '2024-02-02 07:08:05'),
(109, 108, 'DANIEL SLOSS: CAN’T - India Tour 2024 - Delhi', '<p><strong>DANIEL SLOSS - CAN&rsquo;T</strong>&nbsp;is the 12th solo show by Scotland&rsquo;s international comedy superstar and we are delighted to welcome Daniel back to New Delhi!</p>\r\n<p>&nbsp;</p>\r\n<p>Daniel&rsquo;s previous ground-breaking, global smash-hits include &lsquo;HUBRiS&rsquo; (the world&rsquo;s biggest solo comedy touring show and 5th biggest ticket selling event for most of 2021 as reported in Pollstar) and &lsquo;X&rsquo; (his acclaimed tour de force about sexual assault. &lsquo;X&rsquo; toured non-stop for 300 performances over 17 months around the globe, traversing Europe, UK, U.S., Canada, Australia, Hong Kong, Japan and even packing a Moscow arena (becoming Russia&rsquo;s biggest-ever English language comedy show and creating a sensation with a joke about the importance of sex education &ndash; not a taboo subject in Putin&rsquo;s Russia &ndash; an illegal one.). The film of &lsquo;X&rsquo; is on HBO in USA, Canada and was the first UK comedy special with a UK premiere in cinemas, following a nationwide release at Vue.</p>\r\n<p>&nbsp;</p>\r\n<p>Daniel&rsquo;s first book &ldquo;Everyone You Hate is Going to Die&rdquo; was published by Penguin Random House prestige imprint Knopf in 2021, and his Netflix specials &lsquo;DARK&rsquo; &amp; &lsquo;Jigsaw&rsquo; are both streaming in 190 countries, in 26 languages with the infamous &lsquo;Jigsaw&rsquo; credited with causing over 200,000 breakups and 300 divorces world-wide (fans even bring their divorce papers for him to autograph at shows).</p>\r\n<p>&nbsp;</p>\r\n<p>He has sold out seven New York solo off-Broadway seasons, appeared on U.S TV&rsquo;s &lsquo;Conan&rsquo; ten times, broken box office records at the Edinburgh Festival Fringe and toured in 54 countries (so far) - it&rsquo;s a strictly limited tour &ndash; BOOK EARLY!</p>\r\n<p>&nbsp;</p>\r\n<p>With special guest&nbsp;<strong>KAI HUMPHRIES</strong>.</p>\r\n<p>&lsquo;Dirty, sweet and clever&rsquo; (New York Times).</p>', NULL, 'Siri Fort Auditorium, August Kranti Marg, Siri Institutional Area, Siri Fort Institutional Area, Siri Fort, New Delhi, Delhi, India', '28.553264', '77.2129454', 'India', 'Delhi', 'Delhi Division', '110049', 999.00, '2024-01-11', '09:44 AM', '1', 'daniel-sloss-cant-india-tour-2024-delhi', NULL, '2024-02-02 01:11:55', '2024-02-02 07:11:55'),
(110, 108, 'Moonrise Festival 2024', '<p>We are excited to announce the launch of &lsquo;Moonrise Festival&rsquo; - the biggest Valentine\'s event in Delhi-NCR happening at Jawaharlal Nehru Stadium, Delhi.</p>\r\n<p>&nbsp;</p>\r\n<p>A captivating two-day music fest that brings alive an ethereal world of romantic melodies and cult hip hop in the week of Valentine. It is a harmonious blend of different genres of music that artfully captures the conflicting emotions of the heart - from the sweet symphonies of passion to the haunting echoes of heartbreak.</p>', NULL, 'Stadium Gate No. 2, Har Nagar, Sector 16, Dwarka, Delhi, India', '28.6133258', '77.02252899999999', 'India', 'Delhi', 'Delhi Division', '110078', 799.00, '2024-01-12', '10:00 AM', '1', 'moonrise-festival-2024', NULL, '2024-02-02 01:14:09', '2024-02-02 07:14:09'),
(113, 16, '2024 Ultra Music Festival', '<p>The world\'s premier electronic&nbsp;<em>music festival</em>, boasting elite DJs and unparalleled production located in the beautiful city of Miami.</p>\r\n<p><span class=\"w8qArf\">Dates:&nbsp;</span><span class=\"LrzXr kno-fv wHYlTd z8gr9e\">Fri, 22 Mar, 2024 &ndash; Sun, 24 Mar, 2024</span></p>\r\n<p><span class=\"LrzXr kno-fv wHYlTd z8gr9e\"><span class=\"w8qArf\">Location: Bayfront Park, Downtown Miami, FL</span></span></p>', NULL, 'Bayfront Park, Biscayne Boulevard, Downtown Miami, Miami, Florida, USA', '25.7752589', '-80.18618889999999', 'United States', 'Florida', 'Miami-Dade County', '33132', 2500.00, '2024-03-22', '10:00 AM', '1', '2024-ultra-music-festival', NULL, '2024-02-05 01:06:07', '2024-02-05 07:06:07'),
(114, 107, 'Static-X', 'Calling Static-X the terminator of contemporary rock music may like an obvious comparison: the band’s blunt-force-trauma melding of industrial rock and metal disco is nothing if not cybernetic.', NULL, '570 Jernee Mill Rd, South River, NJ 08882, USA', '40.4404065', '-74.35517329999999', '', '', '', '', 250.00, '2024-02-10', '06:00 PM', '1', 'static-x', NULL, '2024-02-05 01:14:24', '2024-02-05 07:14:24'),
