ale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;\">Click <b style=\"box-sizing: border-box; font-weight: bolder;\">Dashboard</b>, and click <b style=\"box-sizing: border-box; font-weight: bolder;\">Settings\r\n\r\n</b></li><li style=\"font-weight: 400; box-sizing: border-box; border: 0px solid rgb(217, 217, 227); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(69,89,164,.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; --tw-shadow: 0 0 transparent; --tw-shadow-colored: 0 0 transparent; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;\"><b style=\"box-sizing: border-box; font-weight: bolder;\">Enable Customize Payment<span style=\"font-weight: 400;\">: Within Settings, locate the \'Customize Payment\' option. By default, the payment is split equally among all guests. To change this, toggle the \'Customize Payment\' option to \'On\'. This allows you to set different payment amounts for each guest.\r\n\r\n</span></b></li><li style=\"box-sizing: border-box; border: 0px solid rgb(217, 217, 227); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(69,89,164,.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; --tw-shadow: 0 0 transparent; --tw-shadow-colored: 0 0 transparent; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;\"><b style=\"box-sizing: border-box;\">Edit Guest Payments<span style=\"font-weight: 400;\">: After enabling the customization option, go to the \'Event Details\' page. Here, you should find an edit icon (often represented by a pencil or similar symbol) next to each guest\'s payment information. Click this icon to enter and adjust the payment amount for each guest individually.<br></span></b></li></ol></li></ol>', '1', '2023-01-12 15:26:23', '2024-01-05 09:02:42');
INSERT INTO `features` (`id`, `heading`, `description`, `image`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Absolutely Zero Cost for Registration', '<p>Dive in with no hidden fees.</p>', '1-zero-cost.png', '1', NULL, '2023-08-30 05:01:40'),
(2, 'Personal Guest List', '<p>Invite guests and craft unforgettable moments together.</p>', '2-guest-list.png', '1', NULL, '2023-08-29 14:05:55'),
(5, 'Effortless Expense Splitting', '<p>Let everyone share the fun and the costs with equal ease.</p>', '3-exp-split.png', '1', NULL, '2023-08-29 10:37:35'),
(6, 'Tailor Your Guest\'s Contribution', '<p>Have the flexibility to set individual costs for your guests, ensuring everyone\'s comfort.</p>', '4-guest-contri.png', '1', NULL, '2023-08-29 10:38:06'),
(7, 'Design Your Unique Event Page', '<p>Our customization tools let you set the perfect mood and theme for your event.</p><div><br></div>', '5-unique-event-pg.png', '1', NULL, '2023-12-08 12:43:00'),
(8, 'Stay Connected All the Time', '<p>Dive into seamless conversations with our Private &amp; Group Messaging feature.</p>', '6-stay-connect.png', '1', NULL, '2023-08-29 10:39:07'),
(9, 'Full Financial Transparency', '<p>Guests always know the payment status, eliminating awkward reminders.</p>', '7-financial-transparency.png', '1', NULL, '2023-08-29 10:39:38'),
(10, 'Hassle-Free Online Payments', '<p>Securely accept payments with Stripe, ensuring smooth transactions every time.</p>', '8-online-payment.png', '1', NULL, '2023-12-08 12:41:15'),
(11, 'Versatile Offline Payment Options', '<p>We understand everyone\'s comfort. So, whether it\'s Cashapp, Venmo, or others, we\'ve got you covered.</p>', '9-offline-payment.png', '1', NULL, '2023-12-08 12:40:22'),
(12, 'Versatile Offline Payment Options', '<p>We understand everyone\'s comfort. So, whether it\'s Cashapp, Venmo, or others, we\'ve got you covered.<br></p>', 'WUimg4.png', '1', NULL, '2023-12-15 07:29:47');
