(1, 'Get curious. Be inspired. Create your Event.', '<p style=\"margin-right: 0px; margin-bottom: 35px; margin-left: 0px; padding: 0px; line-height: 30px;\" noto=\"\" sans\",=\"\" sans-serif;\"=\"\"><font color=\"#4c4d56\">Welcome to Made to Split, your go-to platform for hassle-free event planning and straightforward financial management. We\'ve designed a unique space where you can effortlessly invite guests, divide expenses, and track payments—all without breaking a sweat. Whether you\'re a seasoned planner or a last-minute organizer, Made to Split is crafted to make your life easier.</font></p><p style=\"margin-right: 0px; margin-bottom: 35px; margin-left: 0px; padding: 0px; line-height: 30px;\" noto=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"color: rgb(76, 77, 86); background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Our robust set of features includes options for customized event pages, real-time chat, and payment status visibility. Say goodbye to the stress of planning and say hello to a new era of streamlined, transparent, and enjoyable event creation. With Made to Split, you can focus on what truly matters: crafting memorable experiences with the people you care about.</span><br></p>', 'people1.jpg', 'AdobeStock_593398859_(1).jpeg', '1', NULL, '2023-11-13 01:22:48');
